  \"2016-07-27T22:55:54.105951\",\n\t\"name\": \"predicting-the-impact-of-storm-waves-and-sea-level-rise-within-the-papahnaumokukea-marine-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Recent storms and a tsunami (11 March 2011)
  have underscored the intrinsic potential for sea-level rise to damage wildlife populations
  and ecosystems of the low-lying Papahu0101naumokuu0101kea Marine National Monument
  (PMNM). The goal of this study is to provide maps of wave impact and storm-induced
  inundation levels for islands of high conservation value. Vulnerability will be
  assessed for Midway Atoll and Laysan Island using historical data and new high resolution
  Digital Elevation Models (DEMs) for a variety of sea-level rise scenarios. Research
  to date forecasts sea-level rise with only passive flooding scenarios, and until
  now, was limited by a lack of topography data for Hawaiiu2019s remote atolls. Predicting
  impacts of flooding and storm-induced waves is needed to develop climate-change
  adaptation plans for the biological communities and resident endangered species.
  This information is also needed for managers to understand risks and determine emergency
  responses for the range of parameters where natural, historical, and cultural resources
  and remotely stationed personnel may be threatened from sea-level rise and storm-induced
  waves.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
